import React from 'react';
import Link from 'next/link'
import Sound from 'react-sound';
// So you now we make an onClick event with first goal registering a console.log() 

const BalloonWrenchPicFilled = "/balloon-wrench-filled.svg"
const BalloonWrenchPic = "/balloon-wrench.svg"
const TwirlPicFilled = "/twirl-filled.svg" 
const TwirlPic = "/twirl.svg"
const SoundPicOn = "/sound-on.svg"
const SoundPic = "/sound.svg"

const Display = {
    display: "inline"
}

const NoDisplay = {
    display: "none"
}

class Dock extends React.Component {

    state = {
        dockBoolean: false,
        balloonBoolean: false,
        soundBoolean: false
    }

    buttonClicked() {

    }

    DockClicked = () => {
        this.setState({ dockBoolean: !this.dockBoolean } )
        console.log(this.state.dockBoolean)
        if (this.dockBoolean === true) {
        let title = document.querySelector(".oea-title")
        title.style = {NoDisplay}
        let content = document.querySelector(".oea-content")
        content.style = {Display}
        } else {
        let content = document.querySelector(".oea-content")
        content.style = {MockStyle}
        }
    }

    SoundOn = () => {
        console.log("SoundOn called")
    }
    render() {
    return (
        <div className="dock-panel-parent">
        <div className="dock-panel" onClick={this.DockClicked}>
            <div className="search-bar-parent">
                <img className="search-bar-png2" src="/SearchBar.png" alt="-" />
            </div>
            <div className="oea-title">
            <h4 style={MockStyle2} className="oea-text">Omnibox Extension App</h4>
            </div>
            <div style={MockStyle} className="oea-content">
            <img className="back-button-svg" src="/back.svg"  alt="some" />
            <img className="forward-button-svg" src="/forward.svg" alt="some" />
            <img className="iris-svg" src="/iris.svg" alt="some" />
            <img className="twirl-svg" src={ this.props.business ? TwirlPicFilled : TwirlPic} alt="some" />
            <img onClick={ this.BalloonOn } className="balloon-wrench-svg" src={ this.state.balloonBoolean ? BalloonWrenchPicFilled : BalloonWrenchPic } alt="some" />
            <img className="next-template.svg" src="/next-template.svg"  alt="some" />
            <img className="previous-template.svg" src="/previous-template.svg" alt="some" />
            <img className="menu-overflow-svg" src="/illuminati.svg" alt="some" />
            <img className="nav-svg" src="/nav.svg" alt="some" />
            <img className="history-svg" src="/history.svg" alt="some" />
            <img className="snake-svg" src="/snake.svg" alt="some" />
            <img onClick={ this.SoundOn } className="sound-svg" src={ this.state.soundBoolean ? SoundPicOn : SoundPic } alt="some" />


            </div>
            </div>











        <style jsx>{`
        .dock-panel-parent {
            display: flex;
            align-items: center;
            justify-content: center;
        }

        .dock-panel {
                width: 1507px;
                height: 76px;
                font-family: Montserrat;
                font-size: 23px;
                background-color: #000000;
                background-image: linear-gradient(0deg, #000000 0%, #414141 74%);
                position: relative;
                display: flex;
                align-items: center;
                justify-content: center;
                top: 177px;
                color: #2FA4E7;
                border: black;
                z-index: 1;
            } 

            .search-bar-parent {
                pointer-events: none;
            }

            .search-bar-png2 {
                width: 1507px;
                top:0px;
                padding-bottom: 158px;
            }

            .oea-title {

            }

            .oea-text {
                font-family: Montserrat;
                font-size: 38px;
                bottom: 4px;
                position: absolute;
                left: 523px;
            }

            .oea-content {
                font-family: Montserrat;
                font-size: 38px;
                bottom: 4px;
                position: absolute;
                left: 523px;
                display: none
            }


            .back-button-svg {
                height: 66px;
                width: 66px;
                position: absolute;
                top: 0px;
                right: 480px;
            }
            .forward-button-svg {
                height: 66px;
                width: 66px;
                position: absolute;
                top: 9px;
                right: 394px;
            }


            .balloon-wrench-svg {
                height: 66px;
                width: 66px;
                position: absolute;
                top: 9px;
                right:100px;
            }


            .previous-template-svg {
                height: 66px;
                width: 66px;
                position: absolute;
                top: 9px;
                right:300px;
            }

            .next-template-svg {
                height: 66px;
                width: 66px;
                position: absolute;
                top: 9px;
                right:20px;
            }

            .twirl-svg {
                height: 66px;
                width: 66px;
                position: absolute;
                top: 9px;
                left: 200px;
            }


            .nav-svg {
                height: 66px;
                width: 66px;
                position: absolute;
                top: 9px;
                right:20px;
            }

            .history-svg {
                height: 66px;
                width: 66px;
                position: absolute;
                left:502px;
            }

            .menu-overflow-svg {
                height: 66px;
                width: 66px;
                position: absolute;
                top: 9px;
                left:100px;
            }

            .snake-svg {
                height: 66px;
                width: 66px;
                position: absolute;
                top: 9px;
                left: 700px;
            }

            .iris-svg {
                height: 66px;
                width: 66px;
                position: absolute;
                top: 9px;
                left:400px;
            }

            .sound-svg {
                height: 66px;
                width: 66px;
                position: absolute;
                top: 9px;
                left: 286px;
            }




            `}</style>







        </div>
    );
  }
}

  export default Dock;



